int main(int argc, char* argv[])
{
  if (argc != 2) {
    printf("Usage: %s <repeat>\n", argv[0]);
    return 1;
  }
  const int repeat = atoi(argv[1]);

  const int n = 256*256*256*2;
  size_t dat_size = n * sizeof(double);
  size_t tmp_size = 33554432 * sizeof(double);

  std::mt19937 engine(n);
  std::uniform_real_distribution<double> dist(0.0, 1.0);
  double *x = (double*) malloc (dat_size);
  for (int i = 0; i < n; i++) x[i] = dist(engine);

  double *y = (double*) malloc (dat_size);

  double *Y,  *X;

  cudaMalloc((void**)&X, dat_size);
  cudaMemcpy(X, x, dat_size, cudaMemcpyHostToDevice);

  cudaMalloc((void**)&Y, dat_size);

  double *P1, *P2;
  cudaMalloc((void**)&P1, tmp_size);

  cudaMalloc((void**)&P2, tmp_size);

  dim3 b1(64), b2(64), b3(64);
  dim3 g1(16384), g2(16384), g3(16384);

  cudaDeviceSynchronize();
  auto start = std::chrono::steady_clock::now();

  for (int i = 0; i < repeat; i++) {
    ker_zmddft_fwd_256x256x256_cu0<<<g1, b1>>>(X, P1);
    ker_zmddft_fwd_256x256x256_cu1<<<g2, b2>>>(P1, P2);
    ker_zmddft_fwd_256x256x256_cu2<<<g3, b3>>>(P2, Y);
  }

  cudaDeviceSynchronize();
  auto end = std::chrono::steady_clock::now();
  auto time = std::chrono::duration_cast<std::chrono::nanoseconds>(end - start).count();
  printf("Average kernel execution time: %.3f (ms)\n", time * 1e-6f / repeat);

  cudaMemcpy(y, Y, dat_size, cudaMemcpyDeviceToHost);

  double checksum = 0;
  for (int i = 0; i < n; i++) checksum += y[i];
  printf("checksum = %lf\n", checksum);

  cudaFree(X);
  cudaFree(Y);
  cudaFree(P1);
  cudaFree(P2);
  free(x);
  free(y);

  return 0;
}
